function set_active_menu_entry(){var e=jQuery("#content_left").data("namespace");jQuery("a[data-namespace='"+e+"']").addClass("active")}function hide_menu(){var e=jQuery("#nav_main");e.hasClass("hidden--off")||e.addClass("hidden--off")}function toggle_menu(){var e=jQuery("#nav_main");e.hasClass("hidden--off")?e.removeClass("hidden--off"):e.addClass("hidden--off")}jQuery(document).ready(function(e){set_active_menu_entry()});